import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <div className="Header">
      <div className="container page-box">
        <div className="row">
          <div className="col-sm-12">
          <div className="pages"><Link to="/">Home</Link></div>
          <div className="pages"><Link to="/about">About</Link></div>
          <div className="pages"><Link to="/packages">Packages</Link></div>
          <div className="pages"><Link to="/resorts">Resorts</Link></div>
          <div className="pages"><Link to="/destinations">Destinations</Link></div>
          <div className="pages"><Link to="/cities">Cities</Link></div>
          <div className="pages"><Link to="/careers">Careers</Link></div>
          <div className="pages"><Link to="/contact">Contact</Link></div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Header;
